import React from "react";
import styled from "styled-components";
import loadable from "@loadable/component";
import bg from "common/image/showcase_hyundai-department.jpeg";

const Header = loadable(() => import("components/main/Header"));
const Footer = loadable(() => import("components/main/Footer"));

const Home: React.FC = () => {
  return (
    <Container>
      <Header />

      <h1>쇼케이스</h1>
      <Navigator>
        <a>프로젝트 의뢰</a>
        <a>채용정보</a>
      </Navigator>
      {/* section start */}
      <Section>
        <Background>
          <img src={bg} />
        </Background>
        {/* title */}
        <TitleWrap>
          <SubTitle>프로젝트 - 현대백화점</SubTitle>

          <Title>
            트렌드 플랫폼으로 전환한
            <strong>더현대 서울</strong>
          </Title>
          <Mores>프로젝트 보기</Mores>
        </TitleWrap>
      </Section>
      {/* section end & page */}
      <Paging>
        <CurrentPage></CurrentPage>
        <TotalPage></TotalPage>
      </Paging>

      <Footer />
    </Container>
  );
};

const Container = styled.div``;

const Background = styled.div``;

const Navigator = styled.nav``;

const Section = styled.div`
  width: 100vw;
  height: 100vw;
`;

const TitleWrap = styled.a`
  display: block;
  position: absolute;
  width: 57.42%;
  margin-left: 30.9%;
  bottom: 19.5%;
  z-index: 1;
  color: #fff;
`;

const SubTitle = styled.span``;

const Title = styled.h2``;

const Mores = styled.p``;

const Paging = styled.div``;

const CurrentPage = styled.span``;

const TotalPage = styled.span``;

export default Home;
